import Vue from "vue";
import Router from "vue-router";
import App from "./pages/event.vue";
import Settings from "./pages/settings.vue";
import Login from "./pages/login.vue";
import Regestration from "./pages/regestration.vue";
import EventId from "./pages/events/_id";
Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/settings",
      name: Settings,
      component: Settings,
    },
    {
      path: "/settings:id",
      name: SettingsId,
      component: SettingsId,
    },
    {
      path: "/",
      name: App,
      component: App,
    },
    {
      path: "/event/:id",
      name: "EventId",
      component: EventId,
    },
    {
      path: "/login",
      name: "Login",
      component: Login,
      meta: {
        layout: "auth-layout",
      },
    },
    {
      path: "/regestration",
      name: "Regestration",
      component: Regestration,
      meta: {
        layout: "auth-layout",
      },
    },
  ],
});
